import React from 'react';

function Footer() {
  return (
    <footer style={{background: '#0f172a', color: '#94a3b8', marginTop: '3rem'}}>
      <div className="container" style={{padding: '24px 0', display: 'flex', alignItems: 'center', justifyContent: 'space-between'}}>
        <div>&copy; {new Date().getFullYear()} CloudCommerce</div>
        <div style={{display: 'flex', gap: '1rem'}}>
          <a href="#" style={{color: '#94a3b8', textDecoration: 'none'}}>Privacy</a>
          <a href="#" style={{color: '#94a3b8', textDecoration: 'none'}}>Terms</a>
          <a href="#" style={{color: '#94a3b8', textDecoration: 'none'}}>Support</a>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
